import React from "react";

const listarClientes = async id =>{
    try{
        const response = await fetch("https://api.apilayer.com/email_verification/customercare@apilayer.com");
        const data = await response.json;
        console.log(data);
    }catch(e){
        console.log("Sua api está com problemas, entre em contato com o técnico adminsitrador do sistema." + e)
    }
}

export default listarClientes;
